package p3223

import "testing"

func Test_minimumLength(t *testing.T) {
	type args struct {
		s string
	}
	tests := []struct {
		name string
		args args
		want int
	}{
		{"Example 1", args{s: "abaacbcbb"}, 5},
		{"Example 2", args{s: "aa"}, 2},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			if got := minimumLength(tt.args.s); got != tt.want {
				t.Errorf("minimumLength() = %v, want %v", got, tt.want)
			}
		})
	}
}

func Benchmark_minimumLength(b *testing.B) {
	b.ReportAllocs()
	b.N = 1_000_000
	for i := 0; i < b.N; i++ {
		minimumLength("")
	}
}

